import React from "react";
import ProjectCard from "./ProjectCard/ProjectCard";
import "./ProjectDetails.css";

const ProjectDetails = (props) => {
  const ptitles = [
    { name: "Assiged", image: "Assigned" },
    { name: "Completed", image: "tickmark" },
    { name: "in Process", image: "clock" },
    { name: "Pending", image: "Pending" },
  ];
  const projectcard = ptitles.map((tt) => {
    return <ProjectCard title={tt.name} imagename={tt.image}></ProjectCard>;
  });
  return <div className="ProjectDetails">{projectcard}</div>;
};

export default ProjectDetails;
